import styled from 'styled-components'

export const Main_wrapper = styled.div`
    display: grid;
    width: 99em;
    grid-template-columns: 8em 1fr;
    grid-template-rows: 55px 1fr;
    grid-gap: 1em;
    height: 45em;
    padding: 0.3em;
    margin: 0 auto;
`

export const Logo = styled.img`
width: 3em;
height: 2.5em;
`
